import React, {useState, useEffect} from 'react'
import './bootstrap-5.2.1/dist/css/bootstrap.min.css';
import './jquery.js';
import './bootstrap-5.2.1/dist/js/bootstrap.min.js';

function Test(){
    const [data,setData]=useState([{}]);

    useEffect(()=>{
        fetch("/members").then(
            res=>res.json()).then(
                data=>{   
                    setData(data);
                    console.log(data);
                }
        )
    },[])

    
}

export default Test;
